from typing import List

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        triplet = []
        nums.sort()
        n = len(nums)
        for firstIdx in range(0, n):
            i = 0
            j = n - 1
            while i < j:
                if i == firstIdx:
                    i += 1
                    continue
                if j == firstIdx:
                    j -= 1
                    continue
                addn = nums[i] + nums[firstIdx] + nums[j]
                if addn == 0:
                    soln = [nums[firstIdx], nums[i], nums[j]]
                    soln.sort()
                    if soln not in triplet:
                        triplet.append(soln)
                    i += 1
                    j -= 1
                elif addn < 0:
                    i += 1
                else:
                    j -= 1
        return triplet

